###########################################################################################################################
#
# [DefaultValue]
# DllPath="Output\Debug\Bin" 表示组件的 DLL 默认放置路径, 如果某个组件指定了 NotUseDefaultDllPath = 1 则不会使用这个路径
# DefaultDll="xxx.dll" 所有找不到指定dll的组件都从这个dll中创建
#
# 如果存在 Redirect, 那么组件的位置信息都从 Redirect->Path 的文件中读取
# [Redirect]
# Path = "D:\Living Project\TenioWorld\TenioSource\Tenio.ini"
#
# [组件ID]
# Info=组件说明
# DLL=所在DLL路径，可以是绝对路径或者相对路径。相对路径指相对于本配置文件的路径
# LogPrefix=输出log时在log前面带上的字符串
# OutputDebugString=VTE  'V' 'T' 'E' 三字符自由组合, 表示是否使用OutputDebugString输出Verbose/Trace/Error类型信息
# WriteToLogFile=VTE  'V' 'T' 'E' 三字符自由组合, 表示是否输出Verbose/Trace/Error类型信息到文件中
# NotUseDefaultDllPath = 1 表示不使用 [DefaultValue] DllPath 的值
#
###########################################################################################################################

[LogDefault]
WriteToLogFile=VTE

[DefaultValue]
DllPath=""

